import React from "react";
import Typed from "react-typed";

const TypingEffect = () => {
  return (
    <Typed
      strings={["Bem-vindo ao meu site!"]}
      typeSpeed={50}
      showCursor={false}
    />
  );
};

export default TypingEffect;
